function getFromBitmask(str, len, fromPos, toPos) {
    var bitmask = [0x20, 0x10, 0x08, 0x04, 0x02, 0x01]; 
    var pos = parseInt((fromPos * len + toPos) / 6);
    var offset = (fromPos * len + toPos) % 6;
    var sByte = str.charCodeAt(pos);
    var result = (sByte - ' '.charCodeAt(0)) & bitmask[offset];
    
    return parseInt(result);
}

function getPos(fromCode, toCode) {
    var fromPos;
    var toPos;
    for (var i = 0; i < localCityData.length; i++) {
        if (localCityData[i]['id'] == fromCode) {
            fromPos = i;
        }
        if (localCityData[i]['id'] == toCode) {
            toPos = i;
        }
    }
    
    return [fromPos, toPos];
}

function checkInfantsNoSeats() {
    var fromCode = YAHOO.util.Dom.get('id_departCity').value;
    var toCode = YAHOO.util.Dom.get('id_returnCity').value;
    var pos = getPos(fromCode, toCode);
    var fromPos = pos[0];
    var toPos = pos[1];
    

}

function getFlightType() {
    var fromCode = YAHOO.util.Dom.get('id_departCity').value;
    var toCode = YAHOO.util.Dom.get('id_returnCity').value;
    var pos = getPos(fromCode, toCode);
    var fromPos = pos[0];
    var toPos = pos[1];
    
    var flightTypeMap = {
        1: 'flex',
        2: 'semiFlex',
        3: 'nonFlex',
        4: 'redeemMiles'
    };
    
    var t = flightTypeMap[2];
    if (fromPos != undefined && toPos != undefined) {
        for (pr in flightTypeMatrix) {
            var result = getFromBitmask(flightTypeMatrix[pr], localCityData.length, fromPos, toPos);
            if (result) {
                t = flightTypeMap[pr];
                break;
            }
        }
    }
    
    return t;
}

function isDirectionAllowed(fromCode, toCode) {
    if (!useDirectionMatrix || !fromCode || !toCode) return true;
    
    var pos = getPos(fromCode, toCode);
    var fromPos = pos[0];
    var toPos = pos[1];
    
    if (fromPos != undefined && toPos != undefined) {
        var result = getFromBitmask(directionMatrix, localCityData.length, fromPos, toPos);
        if (result) {
            return true;
        }
    }
    
    return false;
}

function checkCity(srcCityCode, dstCityCode) {
    if (srcCityCode == dstCityCode
        || !isDirectionAllowed(srcCityCode, dstCityCode)) {
        return false;
    }
    return true;
}

function clearField(ac) {
    if (ac) {
        ac.getInputEl().value = '';
        YAHOO.util.Dom.get(ac.dataSource.source_field).value = ''; 
        YAHOO.util.Cookie.set(ac.cookieName, '', {path: '/'});
        
        
    }
};

function setBtnStateExpandMe(ac) {
    YAHOO.util.Dom.removeClass(ac.extendBtn, 'close');
    YAHOO.util.Dom.addClass(ac.extendBtn, 'expand');
    YAHOO.util.Event.removeListener(ac.extendBtn, 'click');
    YAHOO.util.Event.addListener(ac.extendBtn, 'click', function(e) {
        dcAC.sBoxDialog.hide();
        rcAC.sBoxDialog.hide();
        showCities(ac, true);
        ac.sBoxDialog.show();
    });
};

function setBtnStateClearMe(ac) {                    
    YAHOO.util.Dom.removeClass(ac.extendBtn, 'expand');
    YAHOO.util.Dom.addClass(ac.extendBtn, 'close');
    YAHOO.util.Event.removeListener(ac.extendBtn, 'click');            
    YAHOO.util.Event.addListener(ac.extendBtn, 'click', function(e) {
        clearField(ac);
        setBtnStateExpandMe(ac);
    });
};

function showCities(ac, isShowAll) {
    // fix old browser versions <= FF 3.0
    //YAHOO.util.Dom.setStyle(ac.sBoxDialog.body.children[0].children[1].children[1], 'display', 'none');
    //YAHOO.util.Dom.setStyle(ac.sBoxDialog.body.children[0].children[1].children[0], 'display', 'block');
    YAHOO.util.Dom.setStyle(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(ac.sBoxDialog.body)[0])[1])[1], 'display', 'none');
    YAHOO.util.Dom.setStyle(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(ac.sBoxDialog.body)[0])[1])[0], 'display', 'block');
    
    // fix old browser versions <= FF 3.0
    
    var cities = YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(YAHOO.util.Dom.getChildren(ac.sBoxDialog.body)[0])[1])[0]);
                
    for (var n = 0; n < cities.length; n++) {
        
        // fix old browser versions <= FF 3.0 
        var city = YAHOO.util.Dom.getChildren(cities[n])[0];
        
        if (isShowAll) {
            YAHOO.util.Dom.setStyle(city.parentNode, 'display', 'block');
        }
        
        var srcCityCode = city.getAttribute('cityCode');
        var dstCityCode = YAHOO.util.Dom.get(ac.hiddenFieldAlien).value;
        if (!checkCity(srcCityCode, dstCityCode)) {
            YAHOO.util.Dom.setStyle(city.parentNode, 'display', 'none');
        }
    }
};

function toggleFields() {
    var dcAC_hiddenField = YAHOO.util.Dom.get(dcAC.hiddenField).value;
    var dcAC_value = dcAC.getInputEl().value;
    var rcAC_hiddenField = YAHOO.util.Dom.get(rcAC.hiddenField).value;
    var rcAC_value = rcAC.getInputEl().value;            
    YAHOO.util.Dom.get(dcAC.hiddenField).value = rcAC_hiddenField;
    YAHOO.util.Dom.get(rcAC.hiddenField).value = dcAC_hiddenField;
    dcAC.getInputEl().value = rcAC_value;
    rcAC.getInputEl().value = dcAC_value;
    YAHOO.util.Cookie.set(dcAC.cookieName, rcAC_hiddenField, {path: '/'});
    YAHOO.util.Cookie.set(rcAC.cookieName, dcAC_hiddenField, {path: '/'});
    
    if (dcAC.getInputEl().value == '') {
        setBtnStateExpandMe(dcAC);
    } else {
        setBtnStateClearMe(dcAC)
    }
    if (rcAC.getInputEl().value == '') {
        setBtnStateExpandMe(rcAC);
    } else {
        setBtnStateClearMe(rcAC)
    }    
    
}

function uniqueArray(arrayName) {
    var newArray=new Array();
    label: for(var i=0; i<arrayName.length;i++ ) {  
        for(var j=0; j<newArray.length;j++ ) {
            if (newArray[j][0] == arrayName[i][0] && newArray[j][1] == arrayName[i][1]) continue label;
        }
        newArray[newArray.length] = arrayName[i];
    }
    return newArray;
}


function checkLocalCityData(value, hn, cn) {
    for (var i=0; i<localCityData.length; i++) {
        var item = localCityData[i];
        if (value.toLowerCase() == item.name.toLowerCase() + ' (' + item.country_name.toLowerCase()  + ') ' + item.id.toLowerCase()
            || value.toLowerCase() == item.id.toLowerCase()) {
            YAHOO.util.Dom.get(hn).value = item.id;                
            YAHOO.util.Cookie.set(cn, item.id, {path: '/'});
            return true;
        }
    }
    YAHOO.util.Dom.get(hn).value = '';                
    YAHOO.util.Cookie.set(cn, '', {path: '/'});
    return false;
}

