function setValidDate(dt, dayEl, monthEl) {
    return;
    
    day = dayEl.selectedIndex + 1;
    if (dt.getDate() < day) {
        dayEl.selectedIndex = 0;
        monthEl.selectedIndex = dt.getMonth();
    }
}

function isValidDate(dt, dayEl) {
    day = dayEl.selectedIndex + 1;
    return dt.getDate() == day;
}
